INSERT INTO `sqp_faq` (`id`, `asker_id`, `question`, `answer`, `date_added`, `date_modified`) VALUES
(1, 48, 'In this question I am asked to state whether the question is balanced or not. My problem is that the first part (the word godt = good), which is the actual question, is not balanced and the second part (dårligt = bad à godt = good) is balanced. - What to do?', 'The balance refers to the "request for an answer" (the text in the\r\nbottom left field). The idea is whether, upon hearing or reading the\r\nquestion, the respondent perceives an emphasis on one particular side\r\n("good" for example) or not. \r\n\r\nSo it does not refer to the answer categories. \r\n\r\nSince your questions says "hvor godt" and not "hvor god eller dårlig" it\r\nwould be "unbalanced" even though the answer categories contain both\r\ngodt and dårlig.', '2010-07-15', '2010-07-15 12:18:22'),
(2, 48, 'I notice that if a suggestion is preselected it does not keep the answer if I change it into something else; it goes back to the suggestion. Am I doing something wrong?', 'That is the case for no. categories and introduction or not. These\r\nchoices are automatically coded at the moment you click on them. \r\n\r\nYou can change them by choosing a different option and not opening the\r\nchoice again. However, I am not sure whether you really need to. ', '2010-07-15', '2010-07-15 12:19:05'),
(3, 48, 'I was just not sure if there is a difference in the term "request" and\r\n "Request for an Answer". \r\n\r\nIn my opinion the first part of the "Request  for an Answer" would be the "request" and only contain one sentence, but the suggestion says two sentences, counting (I expect) the full "Request for an Answer" which I will stick to as being the correct answer (two sentences).\r\n\r\nQuestion:\r\n\r\nUd fra, hvad du har hørt, eller ud fra dine egne erfaringer, hvor godt synes du så, det lykkes politiet i Danmark, at forhindre forbrydelser, hvor der anvendes vold eller trusler om vold? Vælg dit svar fra dette kort, hvor 0 betyder, at det lykkes særdeles dårligt og 10 at det lykkes særdeles godt.', 'In linguistics they say that the meaning of a sentence often depends on\r\n"implicatures", that is, implied meanings from other sentences for\r\nexample. \r\n\r\nYou are right that the first sentence is an actual question and forms\r\nthe core of the request''s meaning. \r\n\r\nBut if you would be very literal and rigid, then you could actually say\r\nthat not the first sentence, but only "Vælg dit svar fra dette kort ..."\r\nis the actual request or instruction to provide an answer.\r\n\r\nHowever, this sentence gets its meaning from the previous one "... hvor\r\ngodt synes du så, det lykkes politiet i Danmark, at forhindre\r\nforbrydelser, ...?". Without that first phrase it would not mean\r\nanything, but the first sentence by itself is not what the respondent is\r\nliterally asked to do. \r\n\r\nTherefore both form the "request for an answer" or request together.', '2010-07-15', '2010-07-15 12:20:44'),
(4, 52, 'When do you need our questionnaire for SQP coding?', 'We can process it at any moment at your convenience after any possible\r\nadjustments due to capstan comments have been made. Just send it to us\r\nwhen you are ready and we will put the questions into the system\r\nand send you a username and password with instructions.', '2010-07-15', '2010-07-15 12:21:55'),
(5, 52, 'How long will the coding take? ', 'We will only ask to code 27 questions rather than 50 so it should certainly not take longer than 5 hours in total to code the questions. \r\n\r\nAfter the coding is done we will provide a report to you. ', '2010-07-15', '2010-07-15 14:56:00'),
(6, 116, 'Which questions will be coded?', 'We only ask to code the following items:\r\n\r\nFrom the main questionnaire:\r\n   D4--D6\r\n   D12--D17\r\n\r\nFrom the supplementary questionnaire:\r\n   I4 through I21', '2010-07-16', '2010-07-16 19:17:40');
