(26, 573, 5, 'AT', 0, '', 'Wenn Sie nun an die österreichische Bundesregierung denken, wie zufrieden sind Sie mit der Art und Weise, wie Sie ihre Arbeit verrichtet?', 'sehr unzufrieden	\r\neinigermaßen unzufrieden	\r\neinigermaßen zufrieden	\r\nsehr zufrieden	\r\n'),
