(367, 590, 5, 'DE', 0, '', 'Wie zufrieden sind Sie- alles in allem- mit der gegenwärtigen Wirtschaftslage in Deutschland?\r\nBitte kreuzen Sie das Kästchen an, das Ihrer Meinung am nächsten kommt, wobei 0 bedeutet, dass Sie äußerst unzufrieden sind, und 5, dass Sie äußerst zufrieden sind.\r\nBitte kreuzen Sie ein Kästchen an.', '0 äußerst unzufrieden\r\n1\r\n2\r\n3\r\n4\r\n5 äußerst zufrieden'),
(368, 591, 5, 'DE', 0, '', 'Wenn sie nun einmal an die Leistungen der Bundesregierung in Berlin denken:\r\nWie zufrieden sind Sie mit der Art und Weise, wie sehr sie Ihre Arbeit erledigt?\r\nBitte kreuzen Sie ein Kästchen an.', '0 äußerst unzufrieden\r\n1\r\n2\r\n3\r\n4\r\n5 äußerst zufrieden'),
