(370, 593, 5, 'DE', 0, '', 'Ganz allgemein gesprochen: Glauben Sie, dass man den meisten menschen vertrauen kann, oder dass man im Umgang mit anderen Menschen nicht vorsichtig genug sein kann?\r\nBitte kreuzen Sie ein Kästchen an.', 'Man kann nicht vorsichtig genug sein\r\nDen meisten Menschen kann man vertrauen'),
