(381, 10, 2, 'GR', 0, '', 'Τις καθημερινές, πόση ώρα συνολικά διαβάζετε εφημερίδα;\r\n\r\n', 'Καθόλου 00\r\nΛιγότερο από ½ ώρα 01\r\nΑπό ½ ώρα, έως και 1 ώρα 02\r\nΑπό 1 ώρα, έως και 1½ ώρα 03\r\nΑπό 1½ ώρα, έως και 2 ώρες 04\r\nΑπό 2 ώρες, έως και 2½ ώρες 05\r\nΑπό 2½ ώρες, έως και 3 ώρες 06\r\nΠερισσότερο από 3 ώρες 07'),
(382, 13, 2, 'GR', 0, '', 'Γενικά μιλώντας, θα λέγατε ότι μπορούμε να έχουμε εμπιστοσύνη στους περισσότερους αν-θρώπους, ή ότι πρέπει να είμαστε πάντα επιφυλακτικοί στις σχέσεις μας με τους ανθρώπους; Παρακαλώ να μου απαντήσετε χρησιμοποιώντας την κλίμακα αυτής της κάρτας η οποία ξεκινά από το 0 που σημαίνει ότι πρέπει να είμαστε πάντα επιφυλακτικοί στις σχέσεις μας με τους ανθρώπους και φθάνει στο 10 που σημαίνει ότι μπορούμε να έχουμε εμπιστοσύνη στους περισσότερους ανθρώπους.\r\n\r\n', '00 Πρέπει να είμαστε πάντα επιφυλα-κτικοί στις σχέσεις μας με τους ανθρώ-πους\r\n01\r\n02\r\n03\r\n04\r\n05\r\n06\r\n07\r\n08\r\n09\r\n10 Μπορούμε να έχουμε εμπιστοσύνη στους περισσότε-ρους ανθρώπους'),
(383, 14, 2, 'GR', 0, '', 'Πιστεύετε ότι οι περισσότεροι άνθρωποι θα προσπαθούσαν να σας εκμεταλλευτούν αν\r\nείχαν την ευκαιρία, ή ότι θα προσπαθούσαν να είναι δίκαιοι απέναντί σας; Απαντήστε μου χρησιμοποιώντας την κλίμακα αυτής της κάρτας η οποία ξεκινά από το 0, που σημαίνει ότι οι περισσότεροι άνθρωποι θα προσπαθούσαν να με εκμεταλλευτούν αν\r\nείχαν την ευκαιρία και φθάνει στο 10, που σημαίνει ότι οι περισσότεροι άνθρωποι θα\r\nπροσπαθούσαν να είναι δίκαιοι απέναντί μου.\r\n', '00 Οι περισσότεροι άνθρωποι θα προσπα-θούσαν να με εκμεταλ-λευτούν\r\n01\r\n02\r\n03\r\n04\r\n05\r\n06\r\n07\r\n08\r\n09\r\n10 Οι περισσότεροι άνθρωποι θα προσπαθού-σαν να είναι δίκαιοι απέναντί μου'),
(384, 15, 2, 'GR', 0, '', 'Θα λέγατε ότι τις περισσότερες φορές οι άνθρωποι προσπαθούν να βοηθάνε τον άλλο, ή\r\nότι νοιάζονται κυρίως για τον εαυτό τους; Παρακαλώ απαντήστε μου χρησιμοποιώντας την κλίμακα αυτής της κάρτας.\r\n', '00 Οι άνθρωποι νοιάζονται κυρίως για τον εαυτό τους\r\n01\r\n02\r\n03\r\n04\r\n05\r\n06\r\n07\r\n08\r\n09\r\n10 Οι άνθρωποι προσπαθούν να βοηθάνε τον άλλον'),
(385, 17, 2, 'GR', 0, '', 'Πόσο συχνά η πολιτική φαίνεται τόσο μπερδεμένη που πραγματικά δεν μπορείτε να\r\nκαταλάβετε τι γίνεται; Για να μου απαντήσετε, χρησιμοποιήστε αυτή την κάρτα\r\n\r\n', 'Ποτέ 1\r\nΣπάνια 2\r\nΠου και που 3\r\nΑρκετά συχνά 4\r\nΠολύ συχνά 5'),
(386, 18, 2, 'GR', 0, '', 'Πιστεύετε ότι θα μπορούσατε να συμμετέχετε στις συζητήσεις και τις αποφάσεις μιας\r\nομάδας που ασχολείται με την πολιτική; Απαντήστε μου παρακαλώ χρησιμοποιώντας αυτή την κάρτα.\r\n', 'Σίγουρα όχι 1\r\nΜάλλον όχι 2\r\nΔεν είμαι σίγουρος/η αν θα μπορούσα ή όχι 3\r\nΜάλλον ναι 4\r\nΣίγουρα ναι 5'),
(387, 19, 2, 'GR', 0, '', 'Πόσο δύσκολο ή εύκολο το βρίσκετε, να σχηματίσετε δική σας γνώμη σε πολιτικές\r\nσυζητήσεις, ή για πολιτικές που εφαρμόζονται;\r\nΑπαντήστε μου χρησιμοποιώντας αυτή την κάρτα.\r\n\r\n', 'Πολύ δύσκολο 1\r\nΔύσκολο 2\r\nΟύτε δύσκολο ούτε εύκολο 3\r\nΕύκολο 4\r\nΠολύ εύκολο 5'),
(388, 22, 2, 'GR', 0, '', 'Παρακαλώ πείτε μου τώρα, πόσο εμπιστεύεστε εσείς προσωπικά κάθε έναν από τους θεσμούς που θα σας διαβάσω. Χρησιμοποιήστε την κλίμακα αυτής της κάρτας. Το 0 σημαίνει ότι δεν έχετε καμία εμπιστοσύνη και το 10 σημαίνει ότι έχετε απόλυτη εμπιστοσύνη. Πείτε μου πρώτα για το ελληνικό κοινοβούλιο… Ελληνικό Κοινοβούλιο\r\n\r\n', '00 Καμία απο-λύτως εμπι-στοσύ νη\r\n01\r\n02\r\n03\r\n04\r\n05\r\n06\r\n07\r\n08\r\n09\r\n10 Απόλυτη εμπιστο-σύνη'),
(389, 23, 2, 'GR', 0, '', 'Νόμοι', '00 Καμία απο-λύτως εμπι-στοσύ νη\r\n01\r\n02\r\n03\r\n04\r\n05\r\n06\r\n07\r\n08\r\n09\r\n10 Απόλυτη εμπιστο-σύνη'),
