(391, 111, 2, 'GR', 0, '', 'Συνολικά, με τη σημερινή κατάσταση της οικονομίας στην Ελλάδα, πόσο ικανοποιημένος/η είσαστε; Χρησιμοποιήστε πάλι την ίδια κάρτα.\r\n', '00 Απόλυτα δυσαρεστη-μένος/η\r\n01\r\n02\r\n03\r\n04\r\n05\r\n06\r\n07\r\n08\r\n09\r\n10 Απόλυτα ικανοποιη-μένος/η'),
