(394, 124, 2, 'GR', 0, '', 'Παρακαλώ πείτε μου τώρα πόσο συμφωνείτε ή διαφωνείτε με τις παρακάτω απόψεις.Για κάθε μία που θα σας διαβάσω, πείτε μου αν συμφωνείτε απόλυτα, συμφωνείτε, ούτε συμφωνείτε ούτε διαφωνείτε, διαφωνείτε, διαφωνείτε απόλυτα. Όσο λιγότερο παρεμβαίνει η κυβέρνηση στην οικονομία, τόσο το καλύτερο είναι για την Ελλάδα\r\n', 'Συμφω-νώ από-λυτα 1\r\nΣυμφω νώ 2\r\nΟύτε συμφω-νώ ούτε διαφω-νώ 3\r\nΔιαφω-νώ 4\r\nΔιαφω-νώ από-λυτα 5'),
