(396, 126, 2, 'GR', 0, '', 'Οι εργαζόμενοι χρειάζονται ισχυρά συνδικάτα για να προ0στατεύουν τις συνθήκες εργασίας και τους μισθούς τους\r\n\r\n', 'Συμφω-νώ από-λυτα 1\r\nΣυμφω νώ 2\r\nΟύτε συμφω-νώ ούτε διαφω-νώ 3\r\nΔιαφω-νώ 4\r\nΔιαφω-νώ από-λυτα 5'),
