(417, 586, 2, 'GR', 0, '', 'Πόση ώρα συνολικά διαβάζετε εφημερίδα τις καθημερινές; ΠΑΡΑΚΑΛΩ ΣΗΜΕΙΩΣΤΕ σε ένα από τα παρακάτω κουτάκια', 'Καθόλου 01\r\nΠολύ λίγη ώρα 02\r\nΛίγη ώρα 03\r\nΚάμποση ώρα 04\r\nΑρκετή ώρα 05\r\nΠολύ ώρα 06\r\nΠάρα πολύ ώρα 07'),
(418, 587, 2, 'GR', 0, '', 'Σε ποιο βαθμό συμφωνείτε ή διαφωνείτε με τις παρακάτω απόψεις: «Μερικές φορές η πολιτική μου φαίνεται τόσο μπερδεμένη που πραγματικά δεν μπορώ να καταλάβω τι γίνεται». ΠΑΡΑΚΑΛΩ ΣΗΜΕΙΩΣΤΕ σε ένα από τα παρακάτω κουτάκια\r\n\r\n', 'Συμφωνώ απόλυτα 1\r\nΣυμφωνώ 2\r\nΟύτε συμφωνώ ούτε διαφωνώ 3\r\nΔιαφωνώ 4\r\nΔιαφωνώ απόλυτα 5'),
(419, 588, 2, 'GR', 0, '', '«Πιστεύω ότι θα μπορούσα να συμμετέχω στις συζητήσεις και τις αποφάσεις μιας ομάδας που ασχολείται με πολιτικά ζητήματα». ΠΑΡΑΚΑΛΩ ΣΗΜΕΙΩΣΤΕ σε ένα από τα παρακάτω κουτάκια', 'Συμφωνώ απόλυτα 1\r\nΣυμφωνώ 2\r\nΟύτε συμφωνώ ούτε διαφωνώ 3\r\nΔιαφωνώ 4\r\nΔιαφωνώ απόλυτα 5'),
(420, 589, 2, 'GR', 0, '', '«Μου είναι εύκολο να διαμορφώσω γνώμη σε πολιτικές συζητήσεις, ή για πολιτικές που εφαρμόζονται». ΠΑΡΑΚΑΛΩ ΣΗΜΕΙΩΣΤΕ σε ένα από τα παρακάτω κουτάκια', 'Συμφωνώ απόλυτα 1\r\nΣυμφωνώ 2\r\nΟύτε συμφωνώ ούτε διαφωνώ 3\r\nΔιαφωνώ 4\r\nΔιαφωνώ απόλυτα 5'),
(421, 590, 2, 'GR', 0, '', 'Συνολικά, πόσο ικανοποιημένος/η είσαστε με τη σημερινή κατάσταση της οικονομίας στην Ελλάδα; Παρακαλώ σημειώστε σε ένα από τα παρακάτω κουτάκια το οποίο\r\nβρίσκεται πιο κοντά στη γνώμη σας, με το 0 να σημαίνει ότι είσαστε απόλυτα δυσαρεστημένος/η και το 5 να σημαίνει ότι είσαστε απόλυτα ικανοποιημένος/η.\r\n', '0 Απόλυτα δυσαρεστη-μένος/η\r\n1\r\n2\r\n3\r\n4\r\n5 Απόλυτα ικανοποιηένος/η'),
(422, 591, 2, 'GR', 0, '', 'Πόσο ικανοποιημένος/η είσαστε από τον τρόπο που εκπληρώνει το έργο της η ελληνική κυβέρνηση; ΠΑΡΑΚΑΛΩ ΣΗΜΕΙΩΣΤΕ σε ένα από τα παρακάτω κουτάκια\r\n', '0 Απόλυτα δυσαρεστη-μένος/η\r\n1\r\n2\r\n3\r\n4\r\n5 Απόλυτα ικανοποιη-μένος/η'),
(423, 592, 2, 'GR', 0, '', 'Συνολικά, πόσο ικανοποιημένος/η είσαστε από τον τρόπο που λειτουργεί η δημοκρατία στην Ελλάδα; ΠΑΡΑΚΑΛΩ ΣΗΜΕΙΩΣΤΕ σε ένα από τα παρακάτω κουτάκια', '0 Απόλυτα δυσαρεστη-μένος/η\r\n1\r\n2\r\n3\r\n4\r\n5 Απόλυτα ικανοποιη-μένος/η'),
(424, 593, 2, 'GR', 0, '', 'Γενικά μιλώντας, θα λέγατε ότι μπορούμε να έχουμε εμπιστοσύνη στους περισσότερους ανθρώπους, ή ότι πρέπει να είμαστε πάντα επιφυλακτικοί στις\r\nσχέσεις μας μαζί τους; ΠΑΡΑΚΑΛΩ ΣΗΜΕΙΩΣΤΕ σε ένα από τα δύο τετραγωνάκια, ανάλογα με τη γνώμη σας\r\n', 'Πρέπει να είμαστε πάντα επιφυλακτικοί στις σχέσεις μας με τους ανθρώπους 1\r\nΜπορούμε να έχουμε εμπιστοσύνη στους περισσότερους ανθρώπους 2'),
(425, 594, 2, 'GR', 0, '', 'Πιστεύετε ότι οι περισσότεροι άνθρωποι θα προσπαθούσαν να σας εκμεταλλευτούν αν είχαν την ευκαιρία, ή ότι θα προσπαθούσαν να είναι δίκαιοι απέναντί σας;\r\nΠΑΡΑΚΑΛΩ ΣΗΜΕΙΩΣΤΕ σε ένα από τα δύο τετραγωνάκια, ανάλογα με τη γνώμη σας\r\n\r\n', 'Ο περισσότεροι άνθρωποι θα προσπαθούσαν να με εκμεταλλευτούν 1\r\nΟ περισσότεροι άνθρωποι θα προσπαθούσαν να είναι δίκαιοι απέναντί μου 2'),
(426, 595, 2, 'GR', 0, '', 'Θα λέγατε ότι τις περισσότερες φορές οι άνθρωποι προσπαθούν να βοηθάνε τον άλλον, ή ότι νοιάζονται κυρίως για τον εαυτό τους; ΠΑΡΑΚΑΛΩ ΣΗΜΕΙΩΣΤΕ σε ένα από τα δύο τετραγωνάκια ανάλογα με τη γνώμη σας\r\n', 'Οι άνθρωποι νοιάζονται κυρίως για τον εαυτό τους 1\r\nΟι άνθρωποι προσπαθούν να βοηθάνε τον άλλον 2'),
(427, 596, 2, 'GR', 0, '', 'Σας παρακαλώ, τώρα να σημειώστε πόση εμπιστοσύνη έχετε στο ελληνικό κοινοβούλιο, χρησιμοποιώντας έναν αριθμό από το 0 έως το 10. Αν δεν έχετε καμία απολύτως εμπιστοσύνη σημειώστε 0. Αν έχετε απόλυτη εμπιστοσύνη σημειώστε 10. Όσο περισσότερη εμπιστοσύνη έχετε στο ελληνικό κοινοβούλιο τόσο μεγαλύτερος θα είναι και ο βαθμός που θα δώσετε. ΠΑΡΑΚΑΛΩ ΣΗΜΕΙΩΣΤΕ έναν αριθμό από το 0 έως το 10, ανάλογα με την εμπιστοσύνη που έχετε στο ελληνικό κοινοβούλιο.', 'Βαθμός'),
(428, 597, 2, 'GR', 0, '', 'Το ίδιο θα σας ζητούσα να κάνετε για την εμπιστοσύνη που έχετε στους νόμους, χρησιμοποιώντας την ίδια βαθμολογία από το 0 έως το 10. ΠΑΡΑΚΑΛΩ ΣΗΜΕΙΩΣΤΕ έναν αριθμό από το 0 έως το 10, ανάλογα με την εμπιστοσύνη που έχετε στους νόμους.', 'Βαθμός'),
(429, 598, 2, 'GR', 0, '', 'Τέλος, χρησιμοποιείστε πάλι την ίδια κλίμακα από το 0 έως το 10, διαλέγοντας έναν αριθμό για να σημειώσετε πόση εμπιστοσύνη έχετε στην αστυνομία. Σας θυμίζω ότι το 0 σημαίνει ότι δεν έχετε καμία απολύτως εμπιστοσύνη, το 10 ότι έχετε απόλυτη εμπιστοσύνη και ότι όσο περισσότερη εμπιστοσύνη έχετε στην αστυνομία τόσο μεγαλύτερος θα είναι και ο βαθμός που θα δώσετε. ΠΑΡΑΚΑΛΩ ΣΗΜΕΙΩΣΤΕ έναν αριθμό από το 0 έως το 10, ανάλογα με την εμπιστοσύνη που έχετε στην αστυνομία.', 'Βαθμός'),
(430, 599, 2, 'GR', 0, '', 'ΕΡΩΤΗΣΗ: Γενικά, είναι καλό για την Ελλάδα εάν η κυβέρνηση παρεμβαίνει\r\nλιγότερο στην οικονομία; ΠΑΡΑΚΑΛΩ ΣΗΜΕΙΩΣΤΕ σε ένα από τα παρακάτω κουτάκια ανάλογα με τη γνώμη σας\r\n', 'Σίγουρα ναι 1\r\nΜάλλον ναι 2\r\nΔεν είμαι σίγουρος/η 3\r\nΜάλλον όχι 4\r\nΣίγουρα όχι 5'),
(431, 600, 2, 'GR', 0, '', 'ΕΡΩΤΗΣΗ: Η κυβέρνηση πρέπει να λάβει μέτρα για να μειώσει τις διαφορές μεταξύ των εισοδημάτων; ΠΑΡΑΚΑΛΩ ΣΗΜΕΙΩΣΤΕ σε ένα από τα παρακάτω κουτάκια ανάλογα με\r\nτη γνώμη σας', 'Σίγουρα ναι 1\r\nΜάλλον ναι 2\r\nΔεν είμαι σίγουρος/η 3\r\nΜάλλον όχι 4\r\nΣίγουρα όχι 5'),
(432, 601, 2, 'GR', 0, '', 'ΕΡΩΤΗΣΗ: Οι εργαζόμενοι χρειάζονται ισχυρά συνδικάτα για να προστατεύουν τις συνθήκες εργασίας τους και τους μισθούς τους; ΠΑΡΑΚΑΛΩ ΣΗΜΕΙΩΣΤΕ σε ένα από τα παρακάτω κουτάκια ανάλογα με τη γνώμη σας', 'Σίγουρα ναι 1\r\nΜάλλον ναι 2\r\nΔεν είμαι σίγουρος/η 3\r\nΜάλλον όχι 4\r\nΣίγουρα όχι 5'),
(433, 6, 19, 'HU', 0, '', 'Egy átlagos hétköznapon összesen mennyi időt tölt tévénézéssel? Kérem, használja ezt az 1. válaszlapot a válaszadáshoz!', 'Semennyit 00\r\nKevesebbet, mint fél órát 01\r\nmaximum 1 órát 02\r\nmaximum 1 és fél órát 03\r\nmaximum 2 órát 04\r\nmaximum 2 és fél órát 05\r\nmaximum 3 órát 06\r\nLegalább 3 órát vagy többet 07'),
