(436, 13, 19, 'HU', 0, '', 'Használja ezt a 3. válaszlapot! Általánosságban Ön mit mondana: A legtöbb emberben meg lehet bízni, vagy inkább azt, hogy nem lehetünk elég óvatosak az emberi kapcsolatokban? Helyezze el véleményét a skálán, ahol a „0” azt jelenti, hogy nem lehetünk elég óvatosak, a „10” pedig azt, hogy a legtöbb ember megbízható.', '00 Nem lehetünk elég óvatosak\r\n01\r\n02\r\n03\r\n04\r\n05\r\n06\r\n07\r\n08\r\n09\r\n10 A legtöbb ember megbízható'),
