(442, 22, 19, 'HU', 0, '', 'A 11. válaszlap segítségével kérem, mondja meg, hogy Ön személy szerint mennyire bízik meg a következő intézményekben. A „0” azt jelenti, hogy Ön egyáltalán nem bízik az adott intézményben, a „10” pedig azt jelenti, hogy teljesen megbízik benne. Először is Ön személy szerint mennyire bízik meg... … a magyar Országgyűlésben?', '00 Egyáltalán nem bízik meg\r\n01\r\n02\r\n03\r\n04\r\n05\r\n06\r\n07\r\n08\r\n09\r\n10 Teljesen megbízik\r\n'),
