(460, 575, 19, 'HU', 0, '', 'Általánosságban mit mondana, a legtöbb emberben meg lehet bízni, vagy, hogy nem lehet az ember elég óvatos. Kérem mondja meg egy ötfokú skála segítségével, ahol a 0 azt jelenti, hogy az ember nem lehet elég óvatos és az 5-ös. hogy a legtöbb emberben meg lehet bízni.', '0 Nem lehet az ember elég óvatos\r\n1\r\n2\r\n3\r\n4\r\n5 Legtöbb emberben meg lehet bízni'),
