(598, 13, 8, 'IT', 0, '', 'In generale, Lei ritiene che si possa avere fiducia nella maggior parte delle persone, o che non si è mai abbastanza diffidenti con gli estranei?  \r\n		Usando questo cartellino me lo indichi per favore, su una scala da 0 a 10, dove 0 rappresenta la necessità di essere diffidenti e 10 rappresenta la possibilità di fidarsi.\r\n\r\n\r\n\r\n', 'E’ meglio essere diffidenti										Ci si può fidare	\r\n'),
(599, 14, 8, 'IT', 0, '', 'Pensa che la maggior parte delle persone tenterebbe di approfittare di Lei se ne avesse l''opportunità, o cercherebbe di agire correttamente? Usare il cartellino.\r\n		\r\n               ', 'La maggior parte                                                                             La maggior parte      \r\ndelle persone                                                                                   delle persone  	\r\ntenterebbe	                                                                                      agirebbe correctamente\r\ndi approfittarne        '),
(600, 15, 8, 'IT', 0, '', ' Ritiene che la maggior parte delle persone di solito cerca di rendersi utile o   \r\ncura, soprattutto, il proprio interesse?\r\nUsi questo cartellino.\r\n		\r\n', '	Le persone						    		Le persone	\r\n	per lo più curano 						per lo più cercano\r\n	il proprio								di rendersi	                      \r\n	interesse								utili	                              \r\n'),
(601, 17, 8, 'IT', 0, '', 'Quanto spesso le questioni che riguardano la politica e il governo le sembrano così complicate da non riuscire proprio a capire quello che sta succedendo?  Per favore usi  questo cartellino.', '                        Mai	\r\n			Raramente	\r\n			Ogni tanto	\r\n			Regolarmente	\r\n			Molto frequentemente\r\n'),
