(603, 19, 8, 'IT', 0, '', 'Quanto ritiene che sarebbe difficile o facile per lei esprimere il proprio giudizio su complesse questioni politiche?  Per favore usi  questo cartellino.\r\n\r\n', '                        Molto difficile	\r\n			Difficile  	\r\n			Né difficile né facile	\r\n			Facile	\r\n			Molto facile\r\n'),
