(762, 15, 16, 'PL', 0, '', 'Czy uważa P., że ludzie przede wszystkim starają się służyć pomocą innym, czy też, że przede wszystkim dbają o własny interes? Przy odpowiedzi proszę posłużyć się tą kartą.', '00 Ludzie przede wszystkim dbają o własny interes\r\n01\r\n02\r\n03\r\n04\r\n05\r\n06\r\n07\r\n08\r\n09\r\n10 Ludzie przede wszystkim starają się służyć pomocą innym'),
(763, 17, 16, 'PL', 0, '', 'Jak często polityka wydaje się P. na tyle skomplikowana, że tak naprawdę nie może P.\r\nzrozumieć, o co chodzi? Odpowiadając proszę posłużyć się tą kartą.\r\n', 'Nigdy 1\r\nBardzo rzadko 2\r\nOd czasu do czasu 3\r\nDość często 4\r\nCzęsto 5'),
(764, 18, 16, 'PL', 0, '', 'Czy sądzi P., że mógłby/mogłaby P. brać czynny udział w działalności jakiegoś stowarzyszenia lub organizacji zaangażowanej w sprawy polityki? Odpowiadając proszę posłużyć się tą kartą.\r\n', 'Na pewno nie 1\r\nPrawdopodobnie nie 2\r\nNie jestem pewien, czy tak, czy nie 3\r\nPrawdopodobnie tak 4\r\nNa pewno tak 5'),
(765, 19, 16, 'PL', 0, '', 'Na ile trudne lub łatwe jest dla P. wyrobienie sobie własnej opinii w sprawach związanych z wydarzeniami politycznymi? Odpowiadając proszę posłużyć się tą kartą.\r\n', 'Bardzo trudne 1\r\nTrudne 2\r\nAni trudne, ani łatwe 3\r\nŁatwe 4\r\nBardzo łatwe 5'),
(766, 22, 16, 'PL', 0, '', 'Posługując się tą kartą proszę wskazać na skali od 0 do 10 na ile osobiście ma P.\r\nzaufanie do każdej z instytucji, które odczytam. 0 oznacza całkowity brak zaufania wobec instytucji, a 10 oznacza, że ma P. do niej całkowitezaufanie. Pozostałe liczby służą do wyrażenia opinii pośrednich. … polski parlament, tzn. sejm i senat?', '00 Całkowity brak zaufania \r\n01\r\n02\r\n03\r\n04\r\n05\r\n06\r\n07\r\n08\r\n09\r\n10 Całkowite zaufanie'),
