(803, 594, 16, 'PL', 0, '', 'Czy uważa P., że gdyby nadarzyła się okazja, większość ludzi starałaby się P. wykorzystać, czy też starałaby się postępować uczciwie? Odpowiadając proszę posłużyć się tą kartą.\r\n', 'Większość ludzi starałaby się mnie wykorzystać 1\r\nWiększość ludzi starałaby się postępować uczciwie 2'),
