(946, 575, 9, 'ES', 0, '', '¿Diría usted que, por lo general, se puede confiar en la mayoría de la gente, o que nunca se es lo bastante prudente en el trato con los demás? Marque la casilla que mejor describa su opinión, teniendo en cuenta que 0 quiere decir que nunca se es lo bastante prudente y 5 que se puede confiar en la mayoría de la gente.', '00 Nunca se es lo bastante prudente\r\n01\r\n02\r\n03\r\n04\r\n05 Se puede confiar en la mayoría de la gente\r\n'),
(947, 576, 9, 'ES', 0, '', '¿Cree que la mayoría de la gente intentaría aprovecharse de usted si pudiera, o que sería honrada con usted? Por favor, marque una casilla.', '00 La mayoría de la gente intentaría aprovecharse de mí\r\n01\r\n02\r\n03\r\n04\r\n05 La mayoría de la gente sería honrada conmigo'),
(948, 577, 9, 'ES', 0, '', '¿Diría usted que la mayoría de las veces la gente intenta ayudar a los demás o que mira por sí misma? \r\nPor favor, marque una casilla.\r\n', '00 La mayoría de las veces la gente mira por sí misma\r\n01\r\n02\r\n03\r\n04\r\n05 La mayoría de las veces la gente intenta ayudar a los demás'),
(949, 578, 9, 'ES', 0, '', 'Por favor, dígame en una escala de 0 a 10 qué grado de confianza le merecen a Ud. personalmente cada una de las siguientes instituciones. 0 significa que usted no confía en absoluto en una institución, y 10 significa que confía plenamente. \r\nPor favor, marque la casilla que mejor represente su opinión.\r\nEl Parlamento español', '00 No confío en absoluto\r\n01\r\n02\r\n03\r\n04\r\n05\r\n06\r\n07\r\n08\r\n09\r\n10 Confío plenamente'),
(950, 579, 9, 'ES', 0, '', 'El sistema judicial', '00 No confío en absoluto\r\n01\r\n02\r\n03\r\n04\r\n05\r\n06\r\n07\r\n08\r\n09\r\n10 Confío plenamente'),
(951, 580, 9, 'ES', 0, '', 'La policía', '00 No confío en absoluto\r\n01\r\n02\r\n03\r\n04\r\n05\r\n06\r\n07\r\n08\r\n09\r\n10 Confío plenamente'),
(952, 581, 9, 'ES', 0, 'Por favor, indique en qué medida está usted de acuerdo o no con cada una de las siguientes afirmaciones.', '“Cuanto menos intervenga el gobierno en la economía, mejor será para España”.\r\nPor favor marque una casilla.\r\n', 'Totalmente de acuerdo               1\r\nDe acuerdo                               2\r\nNi en desacuerdo ni de acuerdo  3\r\nEn desacuerdo                          4\r\nTotalmente en desacuerdo         5'),
(953, 582, 9, 'ES', 0, '', '“El gobierno debería tomar medidas para reducir las diferencias en los niveles de ingresos”. \r\nPor favor marque una casilla.\r\n', 'Totalmente de acuerdo               1\r\nDe acuerdo                               2\r\nNi en desacuerdo ni de acuerdo  3\r\nEn desacuerdo                          4\r\nTotalmente en desacuerdo         5'),
(954, 583, 9, 'ES', 0, '', '“Los trabajadores necesitan sindicatos fuertes para proteger sus condiciones de trabajo y sus salarios”. \r\nPor favor marque una casilla.\r\n', 'Totalmente de acuerdo               1\r\nDe acuerdo                               2\r\nNi en desacuerdo ni de acuerdo  3\r\nEn desacuerdo                          4\r\nTotalmente en desacuerdo         5'),
(955, 584, 9, 'ES', 0, '', 'En un día laborable, ¿cuánto tiempo pasa usted normalmente viendo la televisión? Por favor, marque una casilla.', 'Nada          01\r\nMuy poco   02\r\nPoco          03\r\nAlgo           04\r\nBastante     05\r\nMucho        06\r\nMuchísimo  07'),
(956, 585, 9, 'ES', 0, '', 'En un día laborable ¿cuánto tiempo pasa normalmente escuchando la radio? Por favor, marque una casilla', 'Nada          01\r\nMuy poco   02\r\nPoco          03\r\nAlgo           04\r\nBastante     05\r\nMucho        06\r\nMuchísimo  07'),
(957, 586, 9, 'ES', 0, '', 'En un día laborable, ¿cuánto tiempo dedica normalmente a leer el periódico?  Por favor, marque una casilla.', 'Nada          01\r\nMuy poco   02\r\nPoco          03\r\nAlgo           04\r\nBastante     05\r\nMucho        06\r\nMuchísimo  07'),
(958, 587, 9, 'ES', 0, 'Por favor, indique en qué medida está usted de acuerdo o no con las siguientes frases.', '“A veces la política me parece tan complicada que no puedo entender muy bien lo que está pasando”. \r\nPor favor, marque una casilla\r\n', 'Totalmente de acuerdo               1\r\nDe acuerdo                                2\r\nNi en desacuerdo ni de acuerdo   3 \r\nEn desacuerdo                           4\r\nTotalmente en desacuerdo          5');
INSERT INTO `sqp_question` (`id`, `item_id`, `language_id`, `country_id`, `percent_done`, `introduction_text`, `rfa_text`, `answer_text`) VALUES
(959, 588, 9, 'ES', 0, '', '“Creo que podría tener un papel activo en un grupo u organización que se dedique a temas políticos”. \r\nPor favor, marque una casilla. \r\n', 'Totalmente de acuerdo               1\r\nDe acuerdo                                2\r\nNi en desacuerdo ni de acuerdo   3 \r\nEn desacuerdo                           4\r\nTotalmente en desacuerdo          5'),
(960, 589, 9, 'ES', 0, '', '"Me resulta fácil formarme una opinión sobre temas políticos”. \r\nPor favor, marque una casilla.\r\n', 'Totalmente de acuerdo               1\r\nDe acuerdo                                2\r\nNi en desacuerdo ni de acuerdo   3 \r\nEn desacuerdo                           4\r\nTotalmente en desacuerdo          5'),
(961, 590, 9, 'ES', 0, '', 'En conjunto, ¿en qué medida está Ud. satisfecho con la situación económica actual en España?\r\nPor favor, marque la casilla que mejor represente su opinión teniendo en cuenta que 0 quiere decir completa-mente insatisfecho y 5 completamente satisfecho\r\n', '00 Completamente insatisfecho\r\n01\r\n02\r\n03\r\n04\r\n05 Completamente satisfecho'),
(962, 591, 9, 'ES', 0, '', 'Y pensando en el gobierno español, ¿en qué medida está Ud. satisfecho con la forma en que está desarrollando su labor? \r\nPor favor, marque una casilla.\r\n', '00 Completamente insatisfecho\r\n01\r\n02\r\n03\r\n04\r\n05 Completamente satisfecho'),
(963, 592, 9, 'ES', 0, '', 'Y, en términos generales, ¿en qué medida está Ud. satisfecho con el funcionamiento de la democracia en España? \r\nPor favor, marque una casilla.\r\n', '00 Completamente insatisfecho\r\n01\r\n02\r\n03\r\n04\r\n05 Completamente satisfecho'),
(964, 593, 9, 'ES', 0, '', '¿Diría usted que, por lo general, se puede confiar en la mayoría de la gente, o que nunca se es lo bastante prudente en el trato con los demás?. \r\nPor favor, marque una casilla.\r\n', 'Nunca se es lo bastante prudente               1\r\nSe puede confiar en la mayoría de la gente  2\r\n'),
(965, 594, 9, 'ES', 0, '', '¿Cree que la mayoría de la gente intentaría aprovecharse de usted si pudiera, o que sería honrada con usted? Por favor, marque una casilla.', 'La mayoría de la gente intentaría aprovecharse de mí      1\r\nLa mayoría de la gente sería honrada conmigo                2\r\n'),
(966, 595, 9, 'ES', 0, '', '¿Diría usted que la mayoría de las veces la gente intenta ayudar a los demás o que mira por sí misma? \r\nPor favor, marque una casilla.\r\n', 'La mayoría de las veces la gente mira por sí misma                 1\r\nLa mayoría de las veces la gente intenta ayudar a los demás    2\r\n'),
(967, 596, 9, 'ES', 0, '', 'Por favor, díganos, utilizando una escala de 0 a 10, qué grado de confianza le merece a Ud. personalmente el Parlamento español. Si no confía en absoluto puntúe con un 0.  Si confía plenamente puntúe con un  10. Cuanto más confíe en el Parlamento, más alta deberá ser su puntuación. Su puntuación:', ''),
(968, 597, 9, 'ES', 0, '', 'Por favor, díganos, utilizando una escala de 0 a 10, qué grado de confianza le merece a Ud. personalmente el sistema judicial. Si no confía en absoluto puntúe con 0. Si confía plenamente puntúe con 10. Cuanto más confíe en el sistema judicial, más alta deberá ser su puntuación.\r\nSu puntuación:\r\n', ''),
(969, 598, 9, 'ES', 0, '', 'Por favor, díganos, utilizando una escala de 0 a 10, qué grado de confianza le merece a Ud. personalmente la policía. Si no confía en absoluto puntúe con 0. Si confía plenamente puntúe con 10. Cuanto más confíe en la policía, más alta deberá ser su puntuación.\r\nSu puntuación:\r\n', ''),
(970, 599, 9, 'ES', 0, '', 'Por lo general, ¿es bueno para España que el gobierno intervenga menos en la economía? \r\nPor favor, marque una casilla.\r\n', 'Por supuesto que sí     1\r\nProbablemente sí         2\r\nNi lo uno ni lo otro        3\r\nProbablemente no        4\r\nPor supuesto que no    5'),
(971, 600, 9, 'ES', 0, '', '¿Debería el gobierno tomar medidas para reducir las diferencias en los niveles de ingresos? \r\nPor favor, marque una casilla.\r\n', 'Por supuesto que sí     1\r\nProbablemente sí         2\r\nNi lo uno ni lo otro        3\r\nProbablemente no        4\r\nPor supuesto que no    5'),
(972, 601, 9, 'ES', 0, '', '¿Necesitan los trabajadores sindicatos fuertes para proteger sus condiciones de trabajo y sus salarios? \r\nPor favor, marque una casilla. \r\n', 'Por supuesto que sí     1\r\nProbablemente sí         2\r\nNi lo uno ni lo otro        3\r\nProbablemente no        4\r\nPor supuesto que no    5'),
(973, 6, 11, 'SE', 0, '', 'Hur mycket tid ägnar du totalt åt att titta på TV en vanlig vardag?\r\nTitta på svarsalternativen på det här kortet.', '1. Ingen tid alls\r\n2. Mindre än ½ timme\r\n3. ½ timme, till 1 timme\r\n4. Mer än 1 timme , upp till 1½ timme\r\n5. Mer än 1½ timme , upp till 2 timmar\r\n6. Mer än 2 timmar , upp till 2½ timme\r\n7. Mer än 2½ timmar, upp till 3 timmar\r\n8. Mer än 3 timmar'),
(974, 8, 11, 'SE', 0, '', 'Hur mycket tid ägnar du totalt åt att lyssna på radio en vanlig vardag?\r\nTitta fortfarande på samma kort.', '1. Ingen tid alls\r\n2. Mindre än ½ timme\r\n3. ½ timme, till 1 timme\r\n4. Mer än 1 timme , upp till 1½ timme\r\n5. Mer än 1½ timme , upp till 2 timmar\r\n6. Mer än 2 timmar , upp till 2½ timme\r\n7. Mer än 2½ timmar, upp till 3 timmar\r\n8. Mer än 3 timmar'),
(975, 10, 11, 'SE', 0, '', 'Hur mycket tid ägnar du totalt åt att läsa dagstidningar en vanlig vardag?\r\nTitta fortfarande på samma kort.', '1. Ingen tid alls\r\n2. Mindre än ½ timme\r\n3. ½ timme, till 1 timme\r\n4. Mer än 1 timme , upp till 1½ timme\r\n5. Mer än 1½ timme , upp till 2 timmar\r\n6. Mer än 2 timmar , upp till 2½ timme\r\n7. Mer än 2½ timmar, upp till 3 timmar\r\n8. Mer än 3 timmar'),
(976, 13, 11, 'SE', 0, '', 'Skulle du säga att man i allmänhet kan lita på de flesta människor\r\neller att man inte kan vara nog försiktig när man har att göra\r\nmed andra människor?\r\nSvara på en skala från 00 till 10, där 00 betyder att man inte\r\nkan vara nog försiktig och 10 betyder att man kan lita på de\r\nflesta människor.\r\nTitta på svarsalternativen på det här kortet', '00 Man kan inte vara nog försiktig \r\n01\r\n02\r\n03\r\n04\r\n05\r\n06\r\n07\r\n08\r\n09\r\n10 Man kan lita på de flesta människor'),
(977, 14, 11, 'SE', 0, '', 'Tror du att de flesta människor skulle försöka utnyttja\r\ndig om de fick chansen eller skulle de försöka vara ärliga\r\noch rättvisa? Titta på svarsalternativen på det här kortet', '00 De flesta människor skulle försöka utnyttja mig\r\n01\r\n02\r\n03\r\n04\r\n05\r\n06\r\n07\r\n08\r\n09\r\n10 De flesta människor skulle försöka vara ärliga och  rättvisa'),
(978, 15, 11, 'SE', 0, '', 'Skulle du säga att människor för det mesta försöker\r\nvara hjälpsamma, eller att de främst ser till sig själva?\r\nTitta på svarsalternativen på det här kortet ', '00 Människor ser främst till sig själva\r\n01\r\n02\r\n03\r\n04\r\n05\r\n06\r\n07\r\n08\r\n09\r\n10 Människor försöker för det mesta vara hjälpsamma'),
(979, 17, 11, 'SE', 0, '', 'Hur ofta verkar politik så komplicerat att du inte riktigt\r\nförstår vad det handlar om?\r\nTitta på svarsalternativen på det här kortet', '1 Aldrig\r\n2 Sällan\r\n3 Ibland\r\n4 Med jämna mellanrum\r\n5 Ofta'),
(980, 18, 11, 'SE', 0, '', 'Tror du att du skulle kunna delta aktivt i en grupp\r\nsom är engagerad i politiska frågor?\r\nTitta på svarsalternativen på det här kortet', '1 Absolut inte\r\n2 Förmodligen inte\r\n3 Kanske, kanske inte\r\n4 Förmodligen\r\n5 Absolut'),
(981, 19, 11, 'SE', 0, '', 'Hur svårt eller lätt tycker du att det är att ta\r\nställning i politiska frågor?\r\nTitta på svarsalternativen på det här kortet', '1 Mycket svårt\r\n2 Svårt\r\n3 Varken svårt eller lätt\r\n4 Lätt\r\n5 Mycket lätt'),
(982, 22, 11, 'SE', 0, '', 'Med hjälp av detta kort vill jag att du, på en skala från 00 till 10, talar om hur stor tillit du personligen\r\nhar till var och en av följande institutioner. 00 betyder att du inte har någon tillit alls till institutionen,\r\noch 10 betyder att du har fullständig tillit. \r\nTill att börja med...\r\n....Sveriges riksdag?', '00 Ingen tillit \r\n01 \r\n02 \r\n03 \r\n04\r\n05 \r\n06 \r\n07 \r\n08 \r\n09 \r\n10 Fullständig alls tillit'),
(983, 23, 11, 'SE', 0, '', 'Rättsväsendet?', '00 Ingen tillit \r\n01 \r\n02 \r\n03 \r\n04\r\n05 \r\n06 \r\n07 \r\n08 \r\n09 \r\n10 Fullständig alls tillit'),
(984, 24, 11, 'SE', 0, '', 'Polisen?', '00 Ingen tillit \r\n01 \r\n02 \r\n03 \r\n04\r\n05 \r\n06 \r\n07 \r\n08 \r\n09 \r\n10 Fullständig alls tillit'),
(985, 111, 11, 'SE', 0, '', 'På det hela taget, hur nöjd är du med den ekonomiska\r\nsituationen i Sverige i dagsläget?\r\nTitta fortfarande på samma', '00 Extremt missnöjd\r\n01\r\n02\r\n03\r\n04\r\n05\r\n06\r\n07\r\n08\r\n09\r\n10 Extremt nöjd'),
(986, 112, 11, 'SE', 0, '', 'Om du tänker på Sveriges regering, hur nöjd är du med hur\r\nden sköter sitt jobb?\r\nTitta fortfarande på samma kort', '00 Extremt missnöjd\r\n01\r\n02\r\n03\r\n04\r\n05\r\n06\r\n07\r\n08\r\n09\r\n10 Extremt nöjd'),
(987, 113, 11, 'SE', 0, '', 'Hur nöjd är du på det hela taget med hur demokratin\r\nfungerar i Sverige?\r\nTitta fortfarande på samma kort', '00 Extremt missnöjd\r\n01\r\n02\r\n03\r\n04\r\n05\r\n06\r\n07\r\n08\r\n09\r\n10 Extremt nöjd'),
(988, 124, 11, 'SE', 0, '', 'Säg i vilken utsträckning du instämmer i eller tar avstånd\r\nfrån vart och ett av följande påståenden.\r\nTitta på svarsalternativen på det här kortet \r\nJu mindre staten ingriper i ekonomin, desto bättre\r\när det för Sverige.', '1 Instämmer starkt\r\n2 Instämmer\r\n3 Varken instämmer eller tar avstånd\r\n4 Tar avstånd\r\n5 Tar starkt avstånd'),
(989, 125, 11, 'SE', 0, '', 'Regeringen och riksdagen bör vidta åtgärder för\r\natt minska inkomstskillnader', '1 Instämmer starkt\r\n2 Instämmer\r\n3 Varken instämmer eller tar avstånd\r\n4 Tar avstånd\r\n5 Tar starkt avstånd'),
(990, 126, 11, 'SE', 0, '', 'Anställda behöver starka fackföreningar för att\r\nvärna om sina arbetsvillkor och löner', '1 Instämmer starkt\r\n2 Instämmer\r\n3 Varken instämmer eller tar avstånd\r\n4 Tar avstånd\r\n5 Tar starkt avstånd'),
(991, 563, 11, 'SE', 0, '', 'Hur mycket tid ägnar du totalt en vanlig vardag åt att titta på TV?', 'Ange antal timmar\r\noch minuter'),
(992, 565, 11, 'SE', 0, '', 'lyssna på radio?', 'Ange antal timmar\r\noch minuter'),
(993, 567, 11, 'SE', 0, '', 'läsa dagstidningar?', 'Ange antal timmar\r\noch minuter'),
(994, 569, 11, 'SE', 0, '', 'Ange i vilken utsträckning du instämmer i eller tar avstånd från vart och ett av följande påståenden. ”Ibland verkar politik så komplicerat att jag inte riktigt förstår vad det handlar om."', '1 Tar starkt avstånd\r\n2 Tar avstånd\r\n3 Varken tar avstånd eller instämmer\r\n4 Instämmer\r\n5 Instämmer starkt'),
(995, 570, 11, 'SE', 0, '', '" Jag tror att jag skulle kunna delta aktivt i en grupp som är engagerad i politiska frågor."', '1 Tar starkt avstånd\r\n2 Tar avstånd\r\n3 Varken tar avstånd eller instämmer\r\n4 Instämmer\r\n5 Instämmer starkt'),
(996, 571, 11, 'SE', 0, '', '"Jag tycker att det är lätt att ta ställning i politiska frågor."', '1 Tar starkt avstånd\r\n2 Tar avstånd\r\n3 Varken tar avstånd eller instämmer\r\n4 Instämmer\r\n5 Instämmer starkt'),
(997, 572, 11, 'SE', 0, '', 'På det hela taget, hur nöjd är du med den ekonomiska situationen\r\ni Sverige i dagsläget?', '1 Mycket missnöjd\r\n2 Ganska missnöjd\r\n3 Ganska nöjd\r\n4 Mycket nöjd'),
(998, 573, 11, 'SE', 0, '', 'Om du tänker på Sveriges regering, hur nöjd är du med hur den\r\nsköter sitt jobb?', '1 Mycket missnöjd\r\n2 Ganska missnöjd\r\n3 Ganska nöjd\r\n4 Mycket nöjd'),
(999, 574, 11, 'SE', 0, '', 'Hur nöjd är du på det hela taget med hur demokratin fungerar i Sverige?', '1 Mycket missnöjd\r\n2 Ganska missnöjd\r\n3 Ganska nöjd\r\n4 Mycket nöjd'),
(1000, 575, 11, 'SE', 0, '', 'Skulle du säga att man i allmänhet kan lita på de flesta människor eller att man inte kan vara nog försiktig när man har att göra med andra människor?\r\nAnge ditt svar på en skala från 0 till 5, där 0 betyder att man inte kan vara nog försiktig och 5 betyder att man kan lita på de flesta människor.', '0 Man kan inte vara nog försiktig\r\n1\r\n2\r\n3\r\n4\r\n5 Man kan lita på de flesta människor');
