INSERT INTO `sqp_validationrule` (`id`, `name`, `rule`, `failure_message`, `type`) VALUES
(1, 'not_empty', 'valid = value', 'you must make a choice.', 'ERROR'),
(2, 'numeric', 'valid = True\r\ntry:\r\n   int(value)\r\nexcept ValueError:\r\n   valid = False', 'the choice must be numeric.', 'ERROR'),
(3, 'LE_nwords_rfa', 'nwords = question.get_coding_for(''Number of words in question'', request.user)\r\nif int(value) <= int(nwords.choice): valid = True\r\nelse: valid = False', 'the number must be smaller than or equal to the number of words in the request for an answer.', 'ERROR'),
(4, 'LE_nwords_answer', 'nwords = question.get_coding_for(''Number of words in answer categories'', request.user)\r\nif int(value) <= int(nwords.choice): valid = True\r\nelse: valid = False', 'the number must be smaller than or equal to the number of words in the answer categories.', 'ERROR'),
(5, 'LE_nnouns_rfa', 'nwords = question.get_coding_for(''Total number of nouns in request for an answer'', request.user) \r\nif int(value) <= int(nwords.choice): valid = True \r\nelse: valid = False', 'the number must be smaller than or equal to the total number of nouns in request for an answer.', 'ERROR'),
(6, 'LE_nnouns_answer', 'nwords = question.get_coding_for(''Total number of nouns in answer categories'', request.user) \r\nif int(value) <= int(nwords.choice): valid = True \r\nelse: valid = False', 'the number must be smaller than or equal to the total number of nouns in the answer categories.', 'ERROR'),
(7, 'GE_nwords_rfa', 'nwords = question.get_coding_for(''Number of words in question'', request.user)\r\nif int(value) >= int(nwords.choice): valid = True\r\nelse: valid = False', 'the number must be greater than or equal to the number of words in the request for an answer.', 'ERROR'),
(8, 'GE_nwords_answer', 'nwords = question.get_coding_for(''Number of words in answer categories'', request.user)\r\nif int(value) >= int(nwords.choice): valid = True\r\nelse: valid = False', 'the number must be greater than or equal to the number of words in the answer categories.', 'ERROR'),
(9, 'less_than_1000', 'if int(value) < 1000: valid = True\r\nelse: valid = False', 'the number should be smaller than 1000.', 'ERROR'),
(10, 'GE_nsent_intro', 'nsent = question.get_coding_for(''Number of sentences in introduction'', request.user)\r\nif int(value) >= int(nsent.choice): valid = True\r\nelse: valid = False', 'the number must be greater than or equal to the number of sentences.', 'ERROR'),
(11, 'GE_nsent_rfa', 'nsent = question.get_coding_for(''Number of sentences in the question'', request.user)\r\nif int(value) >= int(nsent.choice): valid = True\r\nelse: valid = False', 'the number must be greater than or equal to the number of sentences.', 'ERROR'),
(12, 'LE_ncategories', 'cod_ncat = question.get_coding_for(''Number of categories'', request.user)\r\nvalid = ( int(value) <= int(cod_ncat.choice) )', 'the number you choose must be less than or equal to the number of categories.', 'ERROR');
